import React from 'react'

export const Header = () => {
    return (
        <header className="header">
            <nav className="header__nav">
                <a href="#" className="header__nav-logo">
                    &lt;Resume /&gt;
                </a>
                <ul className="header__nav-list">
                    <li className="header__nav-item"></li>
                </ul>
            </nav>
        </header>
    )
}
